```import tkinter as tk
import random

# Set up the window dimensions
WIDTH, HEIGHT = 800, 600

# Create the main window
root = tk.Tk()
root.title("Fireworks Simulation")

# Create a canvas to draw on
canvas = tk.Canvas(root, width=WIDTH, height=HEIGHT)
canvas.pack()

class Firework:
    def __init__(self, x, y):
        self.x = x
        self.y = y
        self.exploded = False
        self.particles = []

    def update(self):
        if not self.exploded:
            self.y -= 5
            if self.y < HEIGHT // 2:
                self.explode()
        else:
            for particle in self.particles:
                particle.update()

    def explode(self):
        self.exploded = True
        for _ in range(50):
            self.particles.append(Particle(self.x, self.y))

    def draw(self):
        if not self.exploded:
            canvas.create_oval(self.x-2, self.y-2, self.x+2, self.y+2, fill="red")
        else:
            for particle in self.particles:
                particle.draw()

class Particle:
    def __init__(self, x, y):
        self.x = x
        self.y = y
        self.vel_x = random.uniform(-2, 2)
        self.vel_y = random.uniform(-2, 2)

    def update(self):
        self.x += self.vel_x
        self.y += self.vel_y

    def draw(self):
        canvas.create_oval(self.x-1, self.y-1, self.x+1, self.y+1, fill="yellow")

def simulate_fireworks():
    firework = Firework(WIDTH // 2, HEIGHT)
    while True:
        firework.update()
        firework.draw()
        canvas.update_idletasks()
        canvas.after(16)  # 16ms = 60fps

simulate_fireworks()

root.mainloop()```

